    this.state = {
      rating: 0,
      name: ''
    }

  }

  render() {

    function arrayList(data) {
      let arrayList = Object.values(data)

      this.setState({name: this.state.name = arrayList[1]})
      console.log(arrayList[1])
      //return arrayList
    }
    const data = axios.get('http://localhost:4000/')
      .then(function (response) {

        arrayList(response.data)
        //return response.data
        //console.log(response.data)
      })
      .catch(function (error) {

        console.log(error);
      })
    return (

      <div>
        <div className="App">
          <h1>{this.state.name}</h1>
        </div>
      </div>

    );
  }
}

export default App;
